properties.widgets.BigQueryTable-batchsource:
{
  "outputs": [{
    "name": "schema",
    "widget-type": "schema",
    "label": "schema",
    "widget-attributes": {
      "schema-types": [
        "boolean",
        "int",
        "long",
        "float",
        "double",
        "bytes",
        "string",
        "array",
        "enum",
        "record",
        "map",
        "union"
      ],
      "schema-default-type": "string",
      "property-watch": "format"
    }
  }],
  "metadata": {"spec-version": "1.5"},
