        {
          "widget-type": "textbox",
          "name": "serviceFilePath",
          "label": "Service Account File Path",
          "widget-attributes": {"placeholder": "Path to service account file (Local to host running on)."}
        },
        {
          "widget-type": "textbox",
          "name": "bucket",
          "label": "Bucket Name",
          "widget-attributes": {"placeholder": "Temporary Google Cloud Storage bucket name."}
        }
      ]
    },
