        },
        {
          "widget-type": "textbox",
          "name": "dataset",
          "label": "Dataset Id",
          "widget-attributes": {"placeholder": "The BigQuery dataset Id the table belongs to."}
        },
        {
          "widget-type": "textbox",
          "name": "table",
          "label": "Table Id",
          "widget-attributes": {"placeholder": "The BigQuery table to read from."},
