properties.widgets.GCSFile-batchsource:
{
  "outputs": [{
    "name": "schema",
    "widget-type": "schema",
    "widget-attributes": {"default-schema": {
      "name": "fileRecord",
      "type": "record",
      "fields": [
        {
          "name": "offset",
          "type": "long"
        },
        {
          "name": "body",
          "type": "string"
        }
      ]
    }}
  }],
  "metadata": {"spec-version": "1.5"},
  "configuration-groups": [
    {
      "label": "Governance",
      "properties": [{
        "widget-type": "textbox",
        "name": "referenceName",
        "label": "Reference Name"
      }]
    },
    {
      "label": "Service Account and Project",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "serviceFilePath",
          "label": "Service Account File Path",
          "widget-attributes": {"placeholder": "Path to service account file (Local to host running on)."}
        },
        {
          "widget-type": "textbox",
          "name": "project",
          "label": "Project Id",
          "widget-attributes": {"placeholder": "The Project Id of GCS."}
        },
        {
          "widget-type": "textbox",
          "name": "bucket",
          "label": "Bucket Name",
          "widget-attributes": {"placeholder": "Temporary Google Cloud Storage bucket name."}
        }
      ]
    },
    {
      "label": "Google Cloud Storage Configuration",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "path",
          "label": "Path",
          "widget-attributes": {"placeholder": "Path to be processed, specified as gs://<bucket>/<dir>/<dir>"}
        },
        {
          "widget-type": "textbox",
          "name": "fileRegex",
          "label": "Regex Path Filter",
          "widget-attributes": {"placeholder": "Regex to filter out files in the path."}
        },
        {
          "widget-type": "textbox",
          "name": "maxSplitSize",
          "label": "Maximum Split Size",
          "widget-attributes": {"placeholder": "Maximum split size for each process specified in bytes."}
        },
        {
          "widget-type": "select",
          "name": "recursive",
          "label": "Read files recursively",
          "widget-attributes": {
            "default": "false",
            "values": [
              "true",
              "false"
            ]
          }
        }
      ]
    },
    {
      "label": "Filename propagation",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "pathField",
          "label": "Propagation as field",
          "widget-attributes": {"placeholder": "Propagate filename or complete path in the field specified."},
          "plugin-function": {
            "widget": "outputSchema",
            "method": "POST",
            "output-property": "schema",
            "plugin-method": "getSchema"
          }
        },
        {
          "widget-type": "select",
          "name": "filenameOnly",
          "label": "Progragate Filename",
          "widget-attributes": {
            "default": "false",
            "values": [
              "true",
              "false"
            ]
          }
        }
      ]
    },
    {
      "label": "Advanced Properties",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "inputFormatClass",
          "label": "Input Format Class"
        },
        {
          "widget-type": "json-editor",
          "name": "fileSystemProperties",
          "label": "File System Properties"
        },
        {
          "widget-type": "select",
          "name": "ignoreNonExistingFolders",
          "label": "Ignore Non-Existing Folders",
          "widget-attributes": {
            "default": "false",
            "values": [
              "true",
              "false"
            ]
          }
        },
        {
          "widget-type": "textbox",
          "name": "timeTable",
          "label": "Time Table",
          "widget-attributes": {"placeholder": "Name of table to remember the last time of processing."}
        }
      ]
    }
  ],
