      "schema-types": [
        "boolean",
        "int",
        "long",
        "float",
        "double",
        "bytes",
        "string",
        "map<string, string>"
      ],
      "schema-default-type": "string"
    }
  }],
  "metadata": {"spec-version": "1.5"},
