          }
        },
        {
          "widget-type": "textbox",
          "name": "samplerate",
          "label": "Sampling Rate",
          "widget-attributes": {"placeholder": "Specify the sampling rate in hertz"}
        },
        {
          "widget-type": "select",
          "name": "profanity",
          "label": "Profanity",
          "widget-attributes": {
            "default": "True",
            "values": [
              "True",
              "False"
            ]
          }
        },
        {
          "widget-type": "textbox",
          "name": "language",
          "label": "Language",
          "widget-attributes": {
            "default": "en-US",
            "values": ["en-US"]
          },
          "plugin-function": {
            "widget": "outputSchema",
            "method": "POST",
            "output-property": "schema",
            "label": "Extract Schema",
            "position": "bottom",
            "plugin-method": "getSchema",
            "multiple-inputs": true,
            "button-class": "btn-hydrator"
          }
        }
      ]
    }
  ],
